const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>

    <Routes>
      {/* <Route path='/' element={<App/>}></Route> */}
      <Route path='/signup' element={<SignUp />}></Route>
      <Route path='/login' element={<Login/>}></Route>
